import React, {useContext} from "react";
import { AuthContext } from "../context/AuthContext";
import dencrypeBtn from "../static/icons/decryped.svg"
import saveBtn from "../static/icons/download.svg"
import deleteBtn from "../static/icons/delete.svg"

export const TextCard=({encrText, elementNum})=>{
    const auth = useContext(AuthContext)
    return (
        <div >
            <div >
                <p >{elementNum}. Chipher №{elementNum}</p>
                <div className="textBlock-icons">
                    <img src={dencrypeBtn} alt="Dencrypte text"/>
                    <img src={saveBtn} alt="Save as file"/>
                    <img src={deleteBtn} alt="Delete encryption"/>
                </div>
            </div>
            
            <p className="textBlock-text">{encrText.text}</p>
            <hr/>
        </div>
    )
}
